import { useState, useEffect } from "react";


const usefetchUrlMovies = (category) => {
    const [movies, setMovies] = useState

    useEffect(() => {
        fetch = (`https://api.themoviedb.org/${category}/550?api_key=41514cf9c5004dbe47144dbf1928e39c`)
            .then(res => res.json())
            .then(data => setMovies(data.results))
    }, [])
    return movies

}
export default usefetchUrlMovies
